import React from "react";
import Panel from "./panel";

const Dashboard = () => {
  return (
    <div className="dshbrd-1">
      <Panel w="6" h="3" convex={true}></Panel>
      <Panel w="6" h="3" row={false}>
        <Panel w="6" convex={true}></Panel>
        <Panel w="14" concave={true}></Panel>
      </Panel>
      <Panel w="6" h="3" row={false}>
        <Panel w="10"> </Panel>
        <Panel w="10"></Panel>
        <Panel w="10" convex={true}></Panel>

        <Panel w="10">
          <Panel w="10" convex={true}></Panel>
          <Panel w="10"></Panel>
        </Panel>
      </Panel>
      <Panel w="3" h="3" row={false}>
        <Panel w="6"></Panel>
        <Panel w="7" convex={true}></Panel>
        <Panel w="5"></Panel>
      </Panel>
      <Panel w="4" h="3" concave={true}></Panel>
      <Panel w="4" h="3" convex={true}></Panel>
    </div>
  );
};

export default Dashboard;
